import React, { Component } from 'react';
import {
  Grid,
  Row,
  Col,
  Button,
  OverlayTrigger,
  Popover,
} from 'react-bootstrap';
import './App.css';
import TsModal from'./tsmodal';

class Timeslots extends Component {
  constructor(props, context) {
    super(props, context);

    this.handleShow = this.handleShow.bind(this);
    this.handleClose = this.handleClose.bind(this);
    this.handleButPush = this.handleButPush.bind(this);
    this.colhour = this.colhour.bind(this);
    this.state = {
      show: false, 
      buttonPush: 'invalid',
      list : [],  
      popoverlist : [{p1: "Available"},{p2: "Available"},{s1:"Available"},{s2: "Available"},{s3:"Available"}]
    };
  }

  componentDidMount() {
    this.getList();
  }

  getList = () => {
    fetch("/purchase")
    .then( (res) => res.json())   
    .then( (json) => {this.setState({list: json});});
  }

  handleClose() {
    this.setState({ show: false });
  }

  handleShow() {
    this.setState({ show: true });
  }
  handleButPush(val) {
    this.setState({ buttonpush: val });
  }
  handlePopoverList(tag) {
    const newList = this.state.popoverlist.slice();
    if(tag === 1) {
      newList[0].p1 = "Booked";
      this.setState({popoverlist : "Booked"});
    }
  }

  popoverHoverFocus(keeptime, butdisable) {
    if(keeptime.keeptime === butdisable.butdisable[0]) {
       if(butdisable.butdisable[0] === 'Pool Table 1') {
        this.handlePopoverList(1);
       }
       if(butdisable.butdisable[0] === 'Pool Table 2') {
        this.setState({popoverlist: 'Booked'});
       }
       if(butdisable.butdisable[0] === 'Snooker Table 1') {
        this.setState({popoverlist: 'Booked'});
       }
       if(butdisable.butdisable[0] === 'Snooker Table 2') {
        this.setState({popoverlist: 'Booked'});
       }
       if(butdisable.butdisable[0] === 'Snooker Table 3') {
        this.setState({popoverlist: 'Booked'});
       }
    }
  return(
  <Popover id="popover-trigger-hover-focus" title="Table status">
    <strong id='p1'>P1 -> {this.state.popoverlist[0].p1} </strong> <br />
    <strong id='p2'>P2 -> {this.state.popoverlist[1].p2}</strong> <br />
    <strong id='s1'>S1 -> {this.state.popoverlist[2].s1}</strong> <br />
    <strong id='s2'>S2 -> {this.state.popoverlist[3].s2}</strong> <br />
    <strong id='s3'>S3 -> {this.state.popoverlist[4].s3}</strong> <br />
  </Popover>
  )
  } 


  colhour(keeptime,butdisable) {
    return(  
        <Col className='halfhour' xs={4} md={1}>
          <TsModal modalid = {this.state.buttonpush} show={this.state.show} onhide={this.handleClose} onclick={this.handleClose} />
            <OverlayTrigger overlay={this.popoverHoverFocus({keeptime},{butdisable})}>
              <Button bsStyle="primary" bsSize="small"  onClick={() => { this.handleShow(); this.handleButPush({keeptime}); }}>
                {keeptime} 
              </Button>
            </OverlayTrigger>
        </Col>
    );
  }

  render() { 
    var slot = this.state.list;
    let time = ['10:00-10:30', '10:30-11:00', '11:00-11:30', '11:30-12:00', '12:00-12:30', '12:30-13:00', '13:00-13:30', '13:30-14:00', '14:00-14:30', 
                '14:30-15:00', '15:00-15:30', '15:30-16:00', '16:00-16:30', '16:30-17:00', '17:00-17:30', '17:30-18:00', '18:00-18:30', '19:00-19:30',
                '19:30-20:00', '20:00-20:30', '20:30-21:00', '21:00-21:30', '22:00-22:30', '22:30-23:00', '23:00-23:30', '23:30-24:00'];
    return (
